INSERT INTO `taluka` VALUES ('Akkalkot','Akkalkot','Akkalkot  About this soundpronunciation  is a town and a municipal council in Solapur district in the Indian state of Maharashtra. It is situated 40 km southeast of Solapur and very close to the border between Maharashtra and Karnataka states.\r\n\r\nAkkalkot was the home to Shri Swami Samarth Maharaj, a 19th-century saint who is believed by his devotees to be an incarnation of Lord Dattatreya. Akkalkot State during the British Raj, was a princely state ruled by the royal Bhonsale dynasty.\r\n\r\n	Akkalkot taluka is bordered by Solapur District to the west and by Karnataka state on all other sides. The district covers an area of 1,407 kmÂ² and contains 138 villages, apart from the town. The total population of the taluka is approximately 290,000 (2001 census), giving a population density of 209 per kmÂ².'),('Barshi','Barshi','Barshi is a city located in Barshi Sub district of Solapur District of Maharashtra State of Republic of India. Barshi is second largest city in Solapur District.It is a hub for business, industry and tourism.Barshi is densely populated.Barshi has high number of lentil industries.Barshi is forthcoming as medical and educational center for rural masses from nearby Marathwada region.OverView of Barshi Barshi is taluka place in Solapur district. B arshi is known as entrance of Marathwada. Barshi is bigger taluka place in Solapur than other cities in Solapur.\r\n\r\n	Barsi As of 2017 projected India census, Barshi has a population of 350000. Males constitute 51% of the population and females 49%. Barshi has an average literacy rate of 87%, higher than the national average of 59.5%; with 56% of the males and 44% of females literate. 12% of the population is under 6 years of age. It had, as per the Census of 1971, a total population of 62,374.'),('Karmala','Karmala','Karmala is a city and a municipal council in Solapur district in the Indian state of Maharashtra. Famous for Sairat movie.\r\n\r\nIt has an average elevation of 562 metres (1,844 ft). About 12 miles (19 km) to the north of the Jeur railway station and about 82 miles (132 km) from the Solapur railway station, Karmala is the headquarters of the taluka bearing the same name. According to the 1971 Census the population was 14,051. This municipal town, being the headquarters of a taluka, has the offices of the Mamlatdar and the Block Development Officer besides that of the Court of the Civil Judge, Junior Division. There is also a police station the jurisdiction of which extends over 96 villages. It has a post and telegraph office. The water-supply to the town is piped and protected.'),('Madha','Madha','Madha is a city in the municipal council of Madha, in Solapur district in the Indian state of Maharashtra. It belongs to Pune Division. It is located 70 KM towards North-West from district head quarters Solapur. Madha is also known for the Madheshawari temple, situated near Mankarna river.'),('Malshiras','Malshiras','Malshiras is a town and the headquarters of Malshiras taluka in Solapur district of Maharashtra state in western India. There are many popular towns in Malshiras taluka such as Akluj, Natepute, Mahalung (for famous Yamai Devi temple), Malinagar, Velapur (for famous Ardhnari Nateshwar temple) and popular Villages like Goradwadi, Bhamburdi, Medad and Palasmandal.\r\n\r\n	Malshiras is a Town in Malshiras Taluka in Solapur District of Maharashtra State, India. It belongs to Desh or Paschim Maharashtra region . It belongs to Pune Division . It is located 127 KM towards west from District head quarters Solapur. It is a Taluka head quarter. '),('Mangalvedhe','Mangalwedha','Mangalwedha is a town with municipal council in Solapur district in the Indian state of Maharashtra. It is the birthplace of Shri Jayatirtha also called as Teekacharya, one of the prominent saints of the Dvaita school of Vedanta.\r\n\r\n	The city of Mangalwedha is situated 55 km west of the district headquarters at Solapur and 25 km southeast of Pandharpur city.Mangalwedha shares its boundaries with Pandharpur, Sangola, Mohol, Jath and Vijapur in Karnataka.As of 2011 India census, Mangalwedha has population of 21,824 of which 11,109 are males while 10,715 are females. Population of Children with age of 0-6 is 2510 which is 11.50 % of total population of Mangalwedha. Female Sex Ratio is of 965 against state average of 929. Literacy rate of Mangalwedha is 81.79 % lower than state average of 82.34 %. In Mangalwedha, Male literacy is around 88.82 % while female literacy rate is 74.55 %. The town has a remarkable number of Kannada speakers along with Marathi.'),('Mohol','Mohol','Mohol is a taluka (town) and a municipal council in Solapur district in the Indian state of Maharashtra,[1] It contains the Nagnath Temple, one of the most important for the Nagesh community.[2] mohol is a big tahasil in solapur district.Mohol is a Taluka in Solapur District of Maharashtra State, India. Mohol Taluka Head Quarters is Mohol town . It belongs to Desh or Paschim Maharashtra region . It belongs to Pune Division . It is located 36 KM towards west from District head quarters Solapur. 380 KM from State capital Mumbai towards west.\r\n\r\n	Mohol Local Language is Marathi. Mohol town Total population is 27833 and number of houses are 5636. Female Population is 49.0%. town literacy rate is 72.7% and the Female Literacy rate is 33.2%.'),('Mohol','Mohol','Pandharpur is a well known pilgrimage town on the banks of Chandrabhaga River in SolÄpur district, Maharashtra, India. Pandharpur is situated on 17.11 north latitude and 75.11 east longitude in Solapur District. The Vithoba temple attracts about a million Hindu pilgrims during the major yÄtrÄ (pilgrimage) in Ashadh (Juneâ€“July). A small temple of Shri. Vitthal-Rukmini is also located, which is as old as the main Vitthal-Rukmini Mandir, in Isbavi area of Pandharpur known as Wakhari Va Korti Devalayas and also known as Visava mandir.\r\n\r\n	According to the 2011 census of India, Pandharpur had a population of 98,000. Males constituted 52% of the population and females, 48%. 71% of the population was literate; 78% males and 64% females. Marathi is the official and main language of people.'),('Sangole','Sangole','Sangole (Sangola) is a town with a municipal council in Solapur District in the Indian state of Maharashtra. It is situated near the borders of Satara District, Sangli District, and Solapur District. It is located at the intersection of state highways SH-161, SH-3, and SH-71.Traditionally, in many historic records this area was part of the Mandesh region. Its name is derived from the Maan River. Sangole is famous for pomegranate production as well as jwara.\r\n\r\n	According to the 2011 Indian census, Sangole had a population of 34,321. Males constituted 51% of the population and females 48%. Sangole had an average literacy rate of 82%. Male literacy was 88%, and female literacy was 77%. Twelve percent of the population was under 6 years of age.'),('SN','North Solapur','North Solapur Taluka is one of the 11 tehsils of Solapur District in the Indian state of Maharashtra. This tehsil is located in the eastern side of district and is bordered by Osmanabad District to the northeast, South Solapur to the south and east, Barshi Taluka to the north and Mohol Taluka to the west. The tehsil headquarters is located at Solapur, which is also the district headquarters and its largest city. As of 2001, the tehsil population was 960,803.'),('SS','South Solapur','South Solapur Taluka is one of the 11 tehsils of Solapur District in the Indian state of Maharashtra. This tehsil is located in the southeastern side of district and is bordered by Osmanabad District to the northeast, North Solapur and Mohol Taluka to the north, Akkalkot Taluka to the southeast, Karnatakas Gulbarga district to the south, and Mangalvedhe Taluka to the west. The tehsil headquarters is located at Solapur, which is also the district headquarters and its largest city. As of 2001, the tehsil population was 210,774.'),('Pandharpur','Pandharpur','Pandharpur is a well known pilgrimage town on the banks of Chandrabhaga River in SolÄpur district, Maharashtra, India. Pandharpur is situated on 17.11 north latitude and 75.11 east longitude in Solapur District. The Vithoba temple attracts about a million Hindu pilgrims during the major yÄtrÄ (pilgrimage) in Ashadh (Juneâ€“July). A small temple of Shri. Vitthal-Rukmini is also located, which is as old as the main Vitthal-Rukmini Mandir, in Isbavi area of Pandharpur known as Wakhari Va Korti Devalayas and also known as Visava mandir.\r\n\r\n	According to the 2011 census of India, Pandharpur had a population of 98,000. Males constituted 52% of the population and females, 48%. 71% of the population was literate; 78% males and 64% females.Marathi is the official and main language of people');
